import React from "react";
import { Container, Box } from "@chakra-ui/react";

const Homepage = () => {
  return (
    <div>
      <Container maxW="xl" centerContent>
        <Box>
          <Text>Talk </Text>
        </Box>
      </Container>
    </div>
  );
};

export default Homepage;
